import { GrayButtonPopup } from "../../styles/Buttons";
import { inputDataSpecialPopup } from "../../styles/Constants";
import { PopupWindowBox } from "../../styles/Input";
import { setSingleInput } from "../functions/setInputsToForm";

export const PopupChoose = ({ props }: any) => {
  return (
    <PopupWindowBox>
      <form onSubmit={props.handle}>
        {setSingleInput(
          inputDataSpecialPopup.data[
            props.options.variant === "deliveryTime" ? 0 : 1
          ],
          props.register,
          ""
        )}
      </form>
      <GrayButtonPopup
        onClick={() => props.setOptions({ isActive: false, variant: "" })}
      >
        Choose
      </GrayButtonPopup>
    </PopupWindowBox>
  );
};
